const TestHeader = () => (
  //   <div>
  //     <Link href='/'>
  //       <a style={linkStyle}>Home</a>
  //     </Link>
  //     <Link href='/about'>
  //       <a style={linkStyle}>About</a>
  //     </Link>
  //   </div>
  <>
    <nav className='navBar'>
      <nav className='wrapper'>
        <div className='logo'></div>
        <input type='checkbox' id='menu-toggle' />
        <label for='menu-toggle' className='label-toggle'></label>
        <ul>
          <li>
            <a href='#'>Lorem</a>
          </li>
          <li>
            <a href='#'>Ipsum</a>
          </li>
          <li>
            <a href='#'>Serum</a>
          </li>
        </ul>
      </nav>
      <style jsx>{`
        #menu-toggle {
          display: none;
        }

        .label-toggle {
          display: none;
        }
        nav ul {
          display: flex;
          justify-content: space-between;
          list-style-type: none;
          width: 50%;
        }
        nav ul a {
          color: yellow;
          text-decoration: none;
          transition: all 0.5s ease;
        }

        nav ul a:hover {
          color: black;
        }

        nav li {
          display: inline-block;
        }

        .logo {
          background-color: green;
          border-radius: 50px;
          display: inline-block;
          height: 45px;
          margin: 1em 0;
          width: 45px;
        }
        .wrapper {
          align-items: center;
          display: flex;
          justify-content: space-between;
        }
        .navBar {
          background-color: purple;
          position: fixed;
          min-width: 100%;
        }
      `}</style>
    </nav>
    <header className='wrapper'>
      <h1>Big ol' Lorem</h1>
      <p>
        Lorem ipsum dolor sit amet, consectetur adipisicing elit. Debitis, sint
        corporis dolores omnis consectetur quaerat nesciunt beatae maiores,
        itaque labore ex vero pariatur nulla non fugiat, facilis eaque sunt
        doloremque!
      </p>
      <style jsx>{`
        .wrapper {
          margin: 0 auto;
          max-width: 960px;
          padding: 0 2%;
        }
        h1 {
          font-size: 3em;
          padding: 1em 0;
        }

        header {
          padding-top: 75px;
        }
      `}</style>
    </header>
  </>
);

export default TestHeader;
